import {ContainerLastMatches, FontNameAndRanking,NameLastMatchsWinner, NameLastMatchLoser, ContainerNameLastMatch} from '../style/style'
import axios from 'axios'
import { useEffect, useState } from 'react'



function LastMatchs () {   
    const [lastmatchs, setLastmatchs] = useState([])
    async function getLastMatchs () {
        const {data} = await axios.get('http://localhost:3333/lastmatchs')
        const reverse = data.reverse()
        setLastmatchs(reverse)
      
       
    }
    useEffect(() => {
        getLastMatchs()
    },[])


    return (
        <ContainerLastMatches>
            <div>
            <FontNameAndRanking>
                Ãšltimas partidas
            </FontNameAndRanking>
            {lastmatchs.map((element, i) => {
               while(i <= 9 ) {
                   return (
                   <ContainerNameLastMatch>
                       <NameLastMatchsWinner>{element.p1} </NameLastMatchsWinner>
                        </ContainerNameLastMatch>
                   )
               } 
            })}
            </div>
            <div>
                <NameLastMatchLoser>{element.p2}</NameLastMatchLoser>
            </div>
        </ContainerLastMatches>
    )
}


export default LastMatchs
